class Solution(object):
    def punishmentNumber(self, n):
        def is_valid(i, sq):
            str_sq = str(sq)
            for j in range(1, len(str_sq)):
                parts = [str_sq[k:k+j] for k in range(0, len(str_sq), j)]
                if sum(map(int, parts)) == i:
                    return True
            return False

        result = 0
        for i in range(1, n + 1):
            sq = i * i
            if '0' not in str(i) and is_valid(i, sq):
                result += sq
        return result
